import Footer from "./components/footer/Footer";

import React, { useState } from "react";
import { Context } from "./Context";

function App() {

  const [context, setContext] = useState([]);

  return (     
    <BrowserRouter>  
      <Header />   
        <Routes>      
          <Route path="/" element={<Catalog />} />
          <Route path="basket" element={<Basket />} />
        </Routes>
      <Footer />
    </BrowserRouter>    
  );
}

export default App;
